package com.bituos.bar.Beans;

/**
 * @author dsa
*/

public class BeanMarca{

	private int id;
	private String marca;
	private byte[] foto;
	
	public int getId() {
		return id;
	}
	public void setId(int id) {
		this.id = id;
	}
	public String getMarca() {
		return marca;
	}
	public void setMarca(String marca) {
		this.marca = marca;
	}
	public byte[] getFoto() {
		return foto;
	}
	public void setFoto(byte[] foto) {
		this.foto = foto;
	}






	
}
